contracts/EventTest.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;


contract  EventTest {

    string private _name;

    event SetName(string  beforeName, string afterName, address who);

    function getName() view public returns(string memory) {
        return _name;
    }

    function setName(string memory name)  public {
        emit SetName(_name, name, msg.sender);
        _name = name;
    }

}

